import React from "react";
import Link from "./Link";

const Header = () => {
  return (
    <nav>
      <ul>
        <Link />
        <li className="menu-item">
          <a
            title="Contacto"
            className="menu-link"
            href="https://adalab.es/contacto/"
          >
            Contacto
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Header;
